import * as React from "react";
import "./box-styles.css";
// using the prop
const smallBox = <div className='box--large'>small lightblue box</div>;
const mediumBox = <div className='box--medium'>medium pink box</div>;
const largeBox = <div className='box--small'>large orange box</div>;

function App() {
    return (
        <div className='box'>
            {smallBox}
            {mediumBox}
            {largeBox}
        </div>
    );
}

export default App;
